import {StyleSheet} from 'react-native';

export default StyleSheet.create({
  tabBarScrollviewContainer: {
    flexDirection: 'row',
  },
  tabBarContainer: {
    flexDirection: 'row',
  },
  tabSectionListContainer: {
    position: 'relative',
  },
});
